// MARK: - Errors

/// Error enum for EntityResolution
public struct EntityResolutionErrorType: AWSErrorType {
    enum Code: String {
        case accessDeniedException = "AccessDeniedException"
        case conflictException = "ConflictException"
        case exceedsLimitException = "ExceedsLimitException"
        case internalServerException = "InternalServerException"
        case resourceNotFoundException = "ResourceNotFoundException"
        case throttlingException = "ThrottlingException"
        case validationException = "ValidationException"
    }

    private let error: Code
    public let context: AWSErrorContext?

    /// initialize EntityResolution
    public init?(errorCode: String, context: AWSErrorContext) {
        guard let error = Code(rawValue: errorCode) else { return nil }
        self.error = error
        self.context = context
    }

    internal init(_ error: Code) {
        self.error = error
        self.context = nil
    }

    /// return error code string
    public var errorCode: String { self.error.rawValue }

    /// You do not have sufficient access to perform this action.
    public static var accessDeniedException: Self { .init(.accessDeniedException) }
    /// The request could not be processed because of conflict in the current state of the resource. Example: Workflow already exists, Schema already exists, Workflow is currently running, etc.
    public static var conflictException: Self { .init(.conflictException) }
    /// The request was rejected because it attempted to create resources beyond the current Entity Resolution account limits. The error message describes the limit exceeded.
    public static var exceedsLimitException: Self { .init(.exceedsLimitException) }
    /// This exception occurs when there is an internal failure in the Entity Resolution service.
    public static var internalServerException: Self { .init(.internalServerException) }
    /// The resource could not be found.
    public static var resourceNotFoundException: Self { .init(.resourceNotFoundException) }
    /// The request was denied due to request throttling.
    public static var throttlingException: Self { .init(.throttlingException) }
    /// The input fails to satisfy the constraints specified by Entity Resolution.
    public static var validationException: Self { .init(.validationException) }
}

extension EntityResolutionErrorType: AWSServiceErrorType {
    public static let errorCodeMap: [String: AWSErrorShape.Type] = [
        "ExceedsLimitException": EntityResolution.ExceedsLimitException.self
    ]
}

extension EntityResolutionErrorType: Equatable {
    public static func == (lhs: EntityResolutionErrorType, rhs: EntityResolutionErrorType) -> Bool {
        lhs.error == rhs.error
    }
}

extension EntityResolutionErrorType: CustomStringConvertible {
    public var description: String {
        return "\(self.error.rawValue): \(self.message ?? "")"
    }
}
